import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SignIn from './components/SignIn';
import SearchBar from './components/SearchBar';
import Homebutton from './components/Homebutton';
import Login from './components/Login';
import SignUpMain from './components/SignUpMain';
import VideoList from './components/VideoList';
import SignUp from './components/SignUp';
import VideoPage from './video page/VideoPage';

const App = () => {
  const containerStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    padding: '20px',
  };

  const authenticationContainerStyle = {
    display: 'flex',
    alignItems: 'center',
  };

  const authenticationItemStyle = {
    marginLeft: '10px',
  };

  return (
    <Router>
      <div style={containerStyle}>
        <div>
          <Homebutton />
        </div>
        <div>
          <SearchBar />
        </div>

        <div style={authenticationContainerStyle}>
          <SignUpMain style={authenticationItemStyle} />
          <Login style={authenticationItemStyle} />
        </div>
      </div>
      <div>
        <VideoList />
      </div>
      <Routes>
        <Route path='/' element={<home />} />
        <Route path='/signin' element={<SignIn />} />
        <Route path='/signup' element={<SignUp />} />
        <Route path='/video/:videoId' element={<VideoPage></VideoPage>} />      </Routes>
    </Router>
  );
};

export default App;
